export default function RectangularShape({x, y, length, breadth }) {
    console.log("Rectangular Shape", x, y, length, breadth);
    const smallerTextStyles = {
        fontSize: '20px',
    };
    return (
        <svg width={length} height={breadth}>
        <rect
            class="rectClass" 
            x= {x}
            y= {y}
            width= {length}
            height={breadth}
        />
        </svg>
    );
}
